import React from 'react';
import logo from './logo.svg';
import './App.css';
import Main from './app/Main';
import AOS from 'aos';
import 'aos/dist/aos.css';

class App extends React.Component {
  constructor(props){
    super(props);
  }
  componentDidMount(){
    AOS.init({
      duration : 2000
    })
  }
  render(){
    return(

      <div className="App">
       <Main ></Main>
    </div>

    )
  }
};

export default App;

